INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000001, "2030/01/01 14:59:59", 190801, 62, 1, 2, "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください", 1, "2025/01/31 12:00:00", -416.5, 0.0, 1, "カリン", 3.414);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000002, "2030/01/01 14:59:59", 190801, 62, 1, 2, "ミッションをクリアして、\n報酬をゲットしましょう！", 2, "2025/01/31 12:00:00", -416.5, 0.0, 1, "カリン", 3.099);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000003, "2030/01/01 14:59:59", 190801, 63, 1, 2, "受け取ることができる\n報酬があるようです\n確認してみてください", 3, "2025/01/31 12:00:00", -416.5, 0.0, 1, "カリン", 2.801);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000004, "2030/01/01 14:59:59", 190801, 63, 1, 2, "報酬がもらえますよ！\nチェックしてみてください", 4, "2025/01/31 12:00:00", -416.5, 0.0, 2, "カリン", 0.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000005, "2030/01/01 14:59:59", 190801, 64, 1, 1, "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ", 5, "2025/01/31 12:00:00", -363.0, 0.0, 2, "カリン", 2.12);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000006, "2030/01/01 14:59:59", 190801, 64, 1, 2, "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ", 6, "2025/01/31 12:00:00", -363.0, 0.0, 1, "カリン", 1.68);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1000007, "2030/01/01 14:59:59", 190801, 64, 1, 1, "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね", 7, "2025/01/31 12:00:00", -363.0, 0.0, 2, "カリン", 2.33);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020101, "2030/01/01 14:59:59", 133701, 61, 10201, 7, "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を", 101, "2025/01/31 12:00:00", -285.0, -6.0, 3, "ラビリスタ", 5.18);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020102, "2030/01/01 14:59:59", 133901, 61, 10201, 2, "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな", 201, "2025/01/31 12:00:00", -285.0, -2.0, 1, "クリスティーナ", 8.77);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020103, "2030/01/01 14:59:59", 133801, 61, 10201, 1, "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます", 301, "2025/01/31 12:00:00", -285.0, 0.0, 6, "ネネカ", 15.5);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020201, "2030/01/01 14:59:59", 134301, 61, 10202, 5, "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…", 101, "2025/02/28 12:00:00", -285.0, 0.0, 2, "ランファ", 9.061);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020202, "2030/01/01 14:59:59", 134401, 61, 10202, 2, "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ", 201, "2025/02/28 12:00:00", -285.0, 0.0, 1, "チカ", 7.699);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020301, "2030/01/01 14:59:59", 134601, 61, 10203, 2, "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！", 101, "2025/03/31 12:00:00", -285.0, 0.0, 1, "アオイ", 8.595);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020302, "2030/01/01 14:59:59", 134501, 61, 10203, 2, "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ", 201, "2025/03/31 12:00:00", -285.0, 0.0, 1, "クローチェ", 7.758);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020401, "2030/01/01 14:59:59", 132302, 61, 10204, 6, "今日はダーリンとの初デート♪\n二人でショッピングして、その後は\n…って私、指名手配されてる！？\nちょ、た…助けてダーリン～！！", 101, "2025/04/30 12:00:00", -285.0, 0.0, 2, "ルイズマリー", 7.0);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020402, "2030/01/01 14:59:59", 132402, 61, 10204, 2, "ルイちゃんのおばあちゃん優しくて\nいつもにこにこで、イロハ大好き♪\nでも一番好きなのは、角がすっごく\n大きくてかっこいいとこなんだ～♪", 201, "2025/04/30 12:00:00", -285.0, 0.0, 1, "イロハ", 7.904);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020403, "2030/01/01 14:59:59", 132502, 61, 10204, 2, "ノゾミちゃんのおかげで売上が安定\nしてきたのに、臨時休業、痛すぎる\n…ま、ルイちゃんのために\n一肌脱ぐか。行くよイロハ～", 301, "2025/04/30 12:00:00", -285.0, 0.0, 4, "ソノ", 8.487);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020502, "2030/01/01 14:59:59", 134901, 61, 10205, 2, "ヲ～ッホッホ♪\nあたくし様と同じお空気を吸える\nお幸運を噛みしめなさいですわ～♪\nヲ～ッホッホッホ～♪", 101, "2025/05/31 12:00:00", -285.0, 0.0, 1, "カノン", 8.763);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020503, "2030/01/01 14:59:59", 134801, 61, 10205, 3, "いきますよ騎士さん！\nカノンさんと力を合わせて…力を…\n…本当にあの人なんなんです？\nこれまでになく不安なんですけど！", 201, "2025/05/31 12:00:00", -285.0, 0.0, 1, "ツムギ", 6.417);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020601, "2030/01/01 14:59:59", 135001, 61, 10206, 7, "『願いが叶う海岸』か…怪しい\nだというのに、阿賀斗紫布菜たちは\n呑気に戯れている…見ていられない\n騎士クンは、わたしが守ってみせる", 101, "2025/06/30 12:00:00", -285.0, 0.0, 3, "エリス", 10.335);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020602, "2030/01/01 14:59:59", 135101, 61, 10206, 4, "せっかくの夏休みなんだし\nたまにはビーチでゆっくりしましょ\n…え、もしかしてこの夏もあんまり\n休めなかったりする感じなの？", 201, "2025/06/30 12:00:00", -285.0, 0.0, 2, "シェフィ", 6.281);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020603, "2030/01/01 14:59:59", 135201, 61, 10206, 2, "いっぱい。たべて\nおおきく。なると\nせーぎ。まもれる。はず\nお兄。いっしょに。スイカ。たべよ", 301, "2025/06/30 12:00:00", -285.0, 0.0, 1, "プレシア", 12.244);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020701, "2030/01/01 14:59:59", 135301, 61, 10207, 8, "ひと夏の冒険のはじまりです！\nアネモネさんも楽しんでくれたら\n…できれば、もう少し\n仲良くなれたらうれしいな…", 101, "2025/07/31 12:00:00", -285.0, 0.0, 2, "クリア", 6.339);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020702, "2030/01/01 14:59:59", 135401, 61, 10207, 9, "─幻の花…\n本当にあるのか謎─ですけど\n探すくらいは、\n付き合ってもいいです", 201, "2025/07/31 12:00:00", -285.0, 0.0, 7, "アネモネ", 8.184);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020801, "2030/01/01 14:59:59", 129101, 61, 10208, 2, "あははっ！　笑う門には福来る！\n笑ってればきっと、複製世界にも\n未来はやってくるって信じてる！\nそうだよね、シナツちゃん！", 101, "2025/08/31 12:00:00", -285.0, 0.0, 9, "アイラ", 3.906);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020802, "2030/01/01 14:59:59", 129201, 61, 10208, 2, "繰り返されるリセットの先の未来\n何度願っても手に入らなかった未来\n…でも、私は諦めない。絶対にだ\nキミも同じだろ…アイラ？", 201, "2025/08/31 12:00:00", -285.0, 0.0, 1, "シナツ", 14.465);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020803, "2030/01/01 14:59:59", 100101, 61, 10208, 3, "アイラの世界のみんなも、\n一生懸命生きてるんだ…！\n…なのに、世界の危機だなんて！\nあたし、絶対、絶対力になるよ！", 301, "2025/08/31 12:00:00", -285.0, 0.0, 4, "ヒヨリ", 8.662);
INSERT INTO `v1_d97fc0e64f2bcfe378ac4042fd8f83dc51b614b52053102ab5411230d78966c4` VALUES (1020804, "2030/01/01 14:59:59", 100301, 61, 10208, 3, "シナツ…もう一人の私\n彼女が大切にしている世界を\n絶対に終わらせはしない…！\n彼女と笑い合える未来のために！", 401, "2025/08/31 12:00:00", -285.0, 0.0, 1, "レイ", 10.915);
